import ApiService from "../apiservice";

class CategoriaService extends ApiService {
    constructor() {
        super('/api/categorias')
    }

    obterCategorias() {
        return this.get('/todas')
    }

    deletar(id) {
        return this.delete(`/${id}`)
    }

}

export default CategoriaService;
